column8:
このミラーを装着するだけで、車全体がレーシーな雰囲気に！純正では決して味わうことの出来ない印象的なデザインが特徴の、軽量コンパクトなＧＴ1タイプ。人気のＬＥＤウインカーを内臓！鮮やかなオレンジに発光。<br><br>モーターを排除することで軽量化。手動タイプでミラーレンズは固定となります。<br><br>●カラー：クローム ●右ハンドル車用<br><br><br>適合車種：スマートフォーツークーペ 450 [2004～2007]※取り付けに加工が必要になる場合があります<br><br>ボディパーツ | ドアミラー<br>スマート | スマートＫ | MC01/450<tr><td colspan="2">
